import React,{useState} from "react";

export const DonorAdmin = () => {

  const [data,setData] = useState([]);

  const getData = async () => {
      try {
          const response = await axios.get("http://127.0.0.1:8001/v1/api/donor")
          //  console.log(response.data)
          setData(response.data.User);
      } catch (error) {
          console.log(error.message);
      }
  };
  
  useEffect(() => {
      getData()
  },[]);

  return (
    <>
      <div className="admin">
        <div className="navadmin">
          <ul className="nav flex-column">
            <li className="nav-item">
              <a className="nav-link" href="/admin">
                Dashboard
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="/admin/user">
                Users
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="/admin/donor">
                Donor
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="/admin/book">
                Book
              </a>
            </li>
            <li className="nav-item">
              <a className="nav-link" href="/admin/notice">
                Notice
              </a>
            </li>
          </ul>
        </div>
        <div>
          <table className="usertable">
            <thead>
              <tr>
                <th scope="col">User Id</th>
                <th scope="col">User Name</th>
                <th scope="col">User Email</th>
              </tr>
            </thead>
            {data && Array.isArray(data) && data.map((el)=>(
            <tbody>
              <tr>
                <th scope="row">{el._id}</th>
                <td>{el.name}</td>
                <td>{el.email}</td>
              </tr>
            </tbody>
            ))}
          </table>
        </div>
      </div>
    </>
  );
};
